import React, { Component } from 'react';

import classNames from 'classnames'


class Buttton extends Component {
  render() {
    return (
      <button className={`button ${this.props.outline ? 'button--outline' : ''}`}>
         {this.props.children}
      </button>
      );
  }
}

export default Buttton;
